import{_ as a,c as t,o as s,a4 as e}from"./chunks/framework.DQYIzER3.js";const f=JSON.parse('{"title":"数据导入指导","description":"","frontmatter":{},"headers":[],"relativePath":"系统设置/数据导入/基础数据导入.md","filePath":"系统设置/数据导入/基础数据导入.md","lastUpdated":null}'),o={name:"系统设置/数据导入/基础数据导入.md"},c=e('<h1 id="数据导入指导" tabindex="-1">数据导入指导 <a class="header-anchor" href="#数据导入指导" aria-label="Permalink to &quot;数据导入指导&quot;">​</a></h1><div class="danger custom-block"><p class="custom-block-title">危险</p><p>该文档为成大软件技术人员使用，客户朋友请不必阅读和使用，不当使用可能造成系统数据错误！！！</p></div><h2 id="一、基础数据模板" tabindex="-1">一、基础数据模板 <a class="header-anchor" href="#一、基础数据模板" aria-label="Permalink to &quot;一、基础数据模板&quot;">​</a></h2><p>按照以下模板修改你需要导入的类别及明细，名称不可重复。</p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/1.%E9%A1%B9%E7%9B%AE%E5%95%86%E5%93%81%E7%B1%BB%E5%88%AB.xls" target="_blank" rel="noreferrer">1.项目商品类别</a></p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/2.%E9%A1%B9%E7%9B%AE%E5%95%86%E5%93%81%E6%98%8E%E7%BB%86.xls" target="_blank" rel="noreferrer">2.项目商品明细</a></p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/3.%E8%81%8C%E4%BD%8D%E5%8F%8A%E6%8A%80%E5%B8%88%E7%B1%BB%E5%88%AB.xls" target="_blank" rel="noreferrer">3.职位及技师类别</a></p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/4.%E6%8A%80%E5%B8%88%E5%91%98%E5%B7%A5%E6%98%8E%E7%BB%86.xls" target="_blank" rel="noreferrer">4.技师员工明细</a></p><p>下面的三个文件是自定义报表的脚本文件，拿到文件后在原软件服务器SQL上执行，会生成三个自定义的报表，去财务部找到并执行，然后你就可以导出excel了。</p><div class="warning custom-block"><p class="custom-block-title">警告</p><p>导入之前，新系统内手牌号码、商品名称、票券名称要和老系统内相同并且已经添加好或导入好！！！</p></div><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/%E6%89%8B%E7%89%8C%E5%BC%80%E7%89%8C%E4%BF%A1%E6%81%AF.txt" target="_blank" rel="noreferrer">5.手牌开牌信息</a></p><p><img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/20240227163520.png" alt="20240227163520"></p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/6.%E6%89%8B%E7%89%8C%E5%BD%93%E5%89%8D%E6%B6%88%E8%B4%B9.txt" target="_blank" rel="noreferrer">6.手牌当前消费</a></p><p><img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/20240227163636.png" alt="20240227163636"></p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/7.%E5%BD%93%E5%89%8D%E5%8F%AF%E7%94%A8%E7%A5%A8%E5%88%B8.txt" target="_blank" rel="noreferrer">7.当前可用票券</a></p><p><img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/20240227163743.png" alt="20240227163743"></p><h2 id="二、基础数据导入" tabindex="-1">二、基础数据导入 <a class="header-anchor" href="#二、基础数据导入" aria-label="Permalink to &quot;二、基础数据导入&quot;">​</a></h2><p>快捷键 ALT+B 系统设置内按快捷键，输入验证密码，密码找开发获取。 按照顺序选择标签页，然后选择要导入的 excel 文件，确认即可，如有重复错误，程序会给出异常！ <img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/20240227152437.png" alt="20240227152437"></p><h2 id="三、手牌内部号导入" tabindex="-1">三、手牌内部号导入 <a class="header-anchor" href="#三、手牌内部号导入" aria-label="Permalink to &quot;三、手牌内部号导入&quot;">​</a></h2><p>按照如下格式，现在 excel 中编辑好手牌号和内部号码。记住，在excel中编辑！！！ <img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/20240227152548.png" alt="20240227152548"></p><p>然后到厅牌设置中，打开导芯片号功能，直接把 excel 中的信息复制进去即可，注意两个手牌号之间不能有回车换行。 <img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/202402271527847.png" alt="image.png"></p><h2 id="四、会员资料导入" tabindex="-1">四、会员资料导入 <a class="header-anchor" href="#四、会员资料导入" aria-label="Permalink to &quot;四、会员资料导入&quot;">​</a></h2><p>快捷键： ALT+I 系统设置内按快捷键，输入验证密码，密码找开发获取。 按照 excel 格式修改好会员的基础信息，列的位置以模板为准！！！</p><p><a href="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/%E4%BC%9A%E5%91%98%E5%AF%BC%E5%85%A5%E6%A8%A1%E6%9D%BF.xls" target="_blank" rel="noreferrer">会员导入模板</a></p><p><img src="https://wiki-cdsoft.oss-cn-hangzhou.aliyuncs.com/20240227153642.png" alt="20240227153642"></p><ul><li>如果你上面按照模板的列的位置编辑的模板，那么你可以从上往下依次填上1-20</li><li>会员卡状态根据实际情况选择映射</li><li>次卡根据实际情况选择映射</li><li>导入的时候会员会员的信息，右侧会有错误信息提示</li><li>正式导入之前一定要先测试好导入的情况，以防正式使用有问题</li><li>测试导入之后，清除掉会员，最后切换的时候再次导入！！！</li></ul>',26),r=[c];function n(i,l,h,p,E,u){return s(),t("div",null,r)}const g=a(o,[["render",n]]);export{f as __pageData,g as default};
